import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Raouter, Router, Routes, Route


} from 'react-router-dom';



import CompShowBlog from './components//blog/showBlog';
import MainComponent from './components/MainComponent/MainComponent';

function App() {
  return (
    <div>
      <MainComponent></MainComponent>

    </div>
  );
}


function Content() {
  return(
    <div>
      <Routes>
          <Route path={'/'} element={<div>Home</div>}></Route>
          <Route path={'/dashboard'} element={<div>DashBoard</div>}></Route>
          <Route path={'/user'} element={<div>User</div>}></Route>
          <Route path={'/etc'} element={<div>etc</div>}></Route>
          <Route path={'/salir'} element={<div>salir</div>}></Route>
      </Routes>
    </div>
  )
}

export default App;
